import { TextInput, View, StyleSheet, TouchableHighlight } from 'react-native'
import React from 'react'
import Button from '../Button'

const RegisterPage = ({ navigation }) => {
  return (
    <View style={styles.container}>

      <Button style={styles.btn} onPress={() => navigation.navigate('Login')}>Registration</Button>
      <Text style={styles.text}>Do you have an account?</Text>
      <Button type='easy' onPress={() => navigation.navigate('Register')}>Login</Button>
    </View>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#120E0B',
    alignItems: 'center',
    justifyContent: 'center',
    width: '90%',
  },
  input: {
    width: '80vw',
    backgroundColor: '#1E2021',
    borderRadius: 10,
    paddingVertical: 15,
    paddingHorizontal: 17,
    marginBottom: 15,
    color: '#fff'
  },
  btn: {
    marginBottom: 15,
  },
});

export default RegisterPage;
